import React, { Component } from 'react';
import '../../App.css';

import 'bootstrap/dist/css/bootstrap.css'
import '@fortawesome/fontawesome-free/css/all.css'

import Navbar from '../NavBar/Navbar'
import Card from '../Card/StdCard'
import LeftNav from '../LeftNav/LeftNav';
import CardWithChart from '../Card/ChartWithChart'
import CardWithChartBar from '../Card/ChartWithChartBar'
import QuickView from '../QuickView/QuickView'
import ReportControl from '../ReportControl/ReportControl'
import ChartCard from '../Card/ChartCard'

export default class MainDashboard extends Component {

  state = { users: [] }

  componentDidMount() {
    fetch('/api/users')
      .then(res => res.json())
      .then(users => this.setState({ users }));
  }

  render() {
    return (
      <div>
        <Navbar/>
        <div class="main-data">
          <LeftNav/>
          <div className="container-fluid">
            <ReportControl/>
            <div className="row">
              <Card className="" headerText="Users" bodyText=
                {this.state.users.map(user =>
                  <div key={user.id}>{user.username}</div>
                )}
              />
            </div>
            <QuickView/>
            <div className="row">
              <CardWithChartBar headerText="Graf Słupkowy"/>
              <CardWithChart headerText="Liczba zapytań"/>
            </div>
            <div className="row">
              <ChartCard chartType="Line" headerText="test"/>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
